func TestCompress(t *testing.T) {
	for i, test := range tests {
		t.Log("test ", i+1)

		got := compress(test.char)
		assert.Equal(t, test.expected, got)
		assert.Equal(t, test.comp, test.char[:got])

		t.Log("got: ", got, ", expected: ", test.expected)
	}
}

func BenchmarkCompress(b *testing.B) {
	funcs := []struct {
		name string
		f    func([]byte) int
	}{
		{"mine", compress},
		{"leet-fastest", compress_leet0ms},
	}

	var res int
	for _, fun := range funcs {

		b.Run(fun.name, func(b *testing.B) {
			b.ReportAllocs()
			b.ResetTimer()
			for k := 0; k < b.N; k++ {
				res = fun.f(tests[k%len(tests)].char)
			}

		})
	}

	result = res
}
